import React, { useState } from "react";

const Index = () => {
  const [item, setItem] = useState(new Array(9).fill(false));
  return (
    <div className="w-full h-screen flex flex-col gap-20 justify-center items-center">
      <div className="grid grid-cols-3 gap-10 justify-center items-center">
        {item.map((el, index) => {
          return (
            <div className="w-40 h-40 border-teal-500 bg-lime-500">
              {index + 1}
            </div>
          );
        })}
      </div>
      <button className="">Start</button>
    </div>
  );
};

export default Index;
